import React from 'react';
import { ResponsiveScatterPlot } from '@nivo/scatterplot';

const data = [
  {
    id: 'Group A',
    data: [
      { x: 10, y: 20 },
      { x: 15, y: 30 },
      { x: 20, y: 10 },
    ],
  },
  {
    id: 'Group B',
    data: [
      { x: 25, y: 40 },
      { x: 30, y: 20 },
      { x: 35, y: 50 },
    ],
  },
];

const ScatterPlot = () => (
  <div style={{ height: 400 }}>
    <ResponsiveScatterPlot
      data={data}
      margin={{ top: 60, right: 140, bottom: 70, left: 90 }}
      xScale={{ type: 'linear', min: 0, max: 50 }}
      xFormat=">-.2f"
      yScale={{ type: 'linear', min: 0, max: 60 }}
      yFormat=">-.2f"
      axisTop={null}
      axisRight={null}
      axisBottom={{
        orient: 'bottom',
        tickSize: 5,
        tickPadding: 5,
        tickRotation: 0,
        legend: 'X axis',
        legendPosition: 'middle',
        legendOffset: 46,
      }}
      axisLeft={{
        orient: 'left',
        tickSize: 5,
        tickPadding: 5,
        tickRotation: 0,
        legend: 'Y axis',
        legendPosition: 'middle',
        legendOffset: -60,
      }}
      colors={{ scheme: 'nivo' }}
      blendMode="multiply"
      animate={true}
      motionStiffness={90}
      motionDamping={15}
    />
  </div>
);

export default ScatterPlot;
